import React from 'react';
import '../style/index.css';
import Logo from './logo'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import user from '../assets/user.png';
import ButtonDropdown from './buttons'
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';

export default function NavbarFunction()  {
    return (
        <div className="navbar">
            <nav>


                <Navbar>
                    <Container>
                        <Navbar.Brand href="#home">Navbar with text</Navbar.Brand>
                        <Navbar.Toggle/>
                        <Navbar.Collapse className="justify-content-end">
                            <Navbar.Text>
                                Signed in as: <a href="#login">Mark Otto</a>
                            </Navbar.Text>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
                );
                }

                export default TextLinkExample;
                <Row>
                    <Col>
                        <div className="nav-logo">
                            <Logo/>
                            <span>
                 <h3 className="nav-text-main">real estate in IRAQ</h3>
            </span>
                        </div>
                    </Col>
                    <Col xs={3}></Col>
                    <Col>
                        <Row className="nav-secondary">
                            <Col className="language" xs={2}>
                                language:
                            </Col>
                            <Col className="theannoyingnav">
                                <ButtonDropdown/>
                            </Col>
                        </Row>
                    </Col>
                </Row>


            </nav>
        </div>


    );
};
